def generate_square_primes(n):
    primes = [True] / (n + 1)
    primes[0] = primes[1] = False
    for i in range(2, int(math.sqrt(n)) + 1):
        if primes[i]:
            for j in range(i * i, n + 1, i):
                primes[j] = False
    square_primes = []
    for i in range(2, n + 1):
